import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({
  containerConfig: {
      alignContent: "center",
      justifyContent: "center",
      alignItems: "center",
      title: "Configurações",
      headerStyle: {
        backgroundColor: "#D5ECB4",
      },
      headerTintColor: "black",
      headerTitleStyle: {
        fontWeight: "bold",
      },
    navConfig:{
      backgroundcolor:"#D5ECB4"
    }}
});
